{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/ivoryj/google-bellebeat-wellness-project?scriptVersionId=99151172\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"c3afa3fb","metadata":{"papermill":{"duration":0.013663,"end_time":"2022-06-23T17:38:21.024743","exception":false,"start_time":"2022-06-23T17:38:21.01108","status":"completed"},"tags":[]},"source":["# Bellabeat Capstone Project with R - How Can a Wellness Technology Company Play It Smart?\n","\n","**For this Case Study, I will be Using the**[FitBit Fitness Tracker Data](http://www.kaggle.com/datasets/arashnic/fitbit).\n","**I am Joy Chuks- Nwosu, but I'd love to be addessed as Ivory.\n","Date: 17th June 2022**\n","\n","# **INTRODUCTION**\n","\n","I will be Showing you my approach to this project as a junior data analyst working on the marketing analyst team at Bellabeat, a high-tech manufacturer of health-focused products for women.\n","PS: This case study is part of the capstone project for \"*Google Data Analytics Proffesional Certificate*\". \n","I will following the steps of the data analysis process: **ask, prepare, process, analyze, share, and act.**\n","\n","**Background - About Bellebeat**\n","Urška Sršen and Sando Mur founded Bellabeat. Bellabeat is a successful small company,a high-tech manufacturer of health-focused products for women, with a potential to become a larger player in the global\n","smart device market. \n","**Urška Sršen**, cofounder and Chief Creative Officer of Bellabeat, believes that analyzing smart device fitness data could help unlock new growth opportunities for the company.\n","\n","**Task:** My team and I have been required to focus on one of Bellabeat’s products and analyze smart device data to gain insight into how consumers are using their smart devices. The insights discovered will then help guide marketing strategy for Bellebeat.\n","\n","**Bellebeat's Products**\n","\n","* **Bellabeat app**: The Bellabeat app provides users with health data related to their activity, sleep, stress, menstrual cycle, and mindfulness habits. This data can help users better understand their current habits and make healthy decisions. The Bellabeat app connects to their line of smart wellness products.\n","\n","* **Leaf**: Bellabeat’s classic wellness tracker can be worn as a bracelet, necklace, or clip. The Leaf tracker connects to the Bellabeat app to track activity, sleep, and stress.\n","\n","* **Time**: This wellness watch combines the timeless look of a classic timepiece with smart technology to track user activity, sleep, and stress. The Time watch connects to the Bellabeat app to provide you with insights into your daily wellness.\n","\n","* **Spring**: This is a water bottle that tracks daily water intake using smart technology to ensure that you are appropriately hydrated throughout the day. The Spring bottle connects to the Bellabeat app to track your hydration levels.\n","\n","* **Bellabeat membership**: Bellabeat also offers a subscription-based membership program for users. Membership gives users 24/7 access to fully personalized guidance on nutrition, activity, sleep, health and beauty, and mindfulness based on their lifestyle and goals.\n","\n","**Bellebeat's Executive team:** \n","* Urška Sršen: Bellabeat’s cofounder and Chief Creative Officer\n","* Sando Mur: Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team\n","\n","At the end of my Analysis, My team and I will present the analysis to the Bellabeat executive team along with a high-level recommendations for Bellabeat’s marketing strategy. \n","We will also produce a report with the following deliverables:\n","1. A clear summary of the business task\n","2. A description of all data sources used\n","3. Documentation of any cleaning or manipulation of data\n","4. A summary of your analysis\n","5. Supporting visualizations and key findings\n","6. Your top high-level content recommendations based on your analysis"]},{"cell_type":"markdown","id":"452a3ca4","metadata":{"papermill":{"duration":0.012505,"end_time":"2022-06-23T17:38:21.050317","exception":false,"start_time":"2022-06-23T17:38:21.037812","status":"completed"},"tags":[]},"source":["# ASK\n","**What is the question that will guide my team to solve this problem?**\n","* What is the problem you are trying to solve? We are trying to unlock new growth opportunities for Bellebeat through analysis of their products and one smart device.\n","* How can your insights drive business decisions?The insights gained from our analysis of samrt device data will help develop new or improved marketing strategy that will yeild desired growth."]},{"cell_type":"markdown","id":"6abd257d","metadata":{"papermill":{"duration":0.012832,"end_time":"2022-06-23T17:38:21.075497","exception":false,"start_time":"2022-06-23T17:38:21.062665","status":"completed"},"tags":[]},"source":["# PREPARE\n","**Sršen** has encouraged that I use public data [FitBit Fitness Tracker Data](https://www.kaggle.com/datasets/arashnic/fitbit) made available through Mobius that explores smart device users’ daily habits. This Kaggle data set contains personal fitness tracker from thirty fitbit users including physical activity recorded in minutes, heart rate, sleep monitoring, daily activity and steps.\n","\n","Data ROCCC Analysis :\n","\n","Reliable : The data was made available on Kaggle  through FitBit from 30 FitBit users, so it is reliable.\n","Original : The data is from personal submissions from these FitBit users via Amazon Mechanical Turk.\n","Comprehensive : Yes, the data tracks many factors in the activities of participants in the survey.\n","Current : The data is a historical data dated as far back as 2016 and as such may not account for changes in users activities and habits and also other factors like the Pandemic(Covid 19) we just survived that could have had a drastic effect on these activities.\n","Cited : It is a public data and thus no known citations."]},{"cell_type":"markdown","id":"91bbb554","metadata":{"papermill":{"duration":0.012283,"end_time":"2022-06-23T17:38:21.100131","exception":false,"start_time":"2022-06-23T17:38:21.087848","status":"completed"},"tags":[]},"source":["# PROCESS\n","I will be R programming language for data cleaning, transformation and visualization.\n","First;\n","* Will Explore and Observe the data\n","* Check for missing entries or null values and duplicates\n","* Check data type and fromat the data type if necessary\n","* Perform Preliminary analyis \n","\n","**LOADING THE LIBRARIES**"]},{"cell_type":"code","execution_count":1,"id":"fd725c1b","metadata":{"execution":{"iopub.execute_input":"2022-06-23T17:38:21.128613Z","iopub.status.busy":"2022-06-23T17:38:21.126519Z","iopub.status.idle":"2022-06-23T17:40:16.812526Z","shell.execute_reply":"2022-06-23T17:40:16.809847Z"},"papermill":{"duration":115.703957,"end_time":"2022-06-23T17:40:16.81625","exception":false,"start_time":"2022-06-23T17:38:21.112293","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.7     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.9\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.0     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ─────────────────────